import React from 'react'
import '../App.css';
export default function Todoli(props) {

    const {todoList} = props;
    const  handleUl = props.handleUl;
    const {handleUldouble} = props;
    const UL = props.UL;
    var newli = document.createElement('li');
    newli.innerHTML = todoList;
    newli.className = 'li_class';
    newli.id = todoList;
    UL.appendChild(newli);

    return (
        <div>
            <li onClick={handleUl} onDoubleClick={handleUldouble} id={todoList} class='li-class'>{todoList}</li>
        </div>
    )
}


